import axios from 'axios';
import { useState } from 'react'
import { useParams } from 'react-router';
import { useEffect } from 'react';
import s from '../styles/dog.module.css'
import { useDispatch } from 'react-redux';

export default function DogDetail(){
    const [dog,setDog] = useState(null);
    let {id} = useParams()
    let dispatch = useDispatch()

    useEffect(() => {
       async function fetchData(){
            try {
                console.log('here')
                await axios.get('http://localhost:3001/api/dogs/'+id)
                .then((response) => {
                    console.log('here')
                    setDog(response.data)
                })

                return () => {
                    setDog(null)
                }
            }
            catch(error){
                console.log(error)
            }
        };
        fetchData()
    }, [] )
    console.log(dog)
    return <div>
        {
            dog ?
            <>
            <h3>{dog.name}</h3>
            <img className={s.image} src={dog.image} alt='imagen'/> 
            <h4>Peso {dog.weightMin}kg - {dog.weightMax}kg</h4>
            <h5>Altura {dog.heightMin}m - {dog.weightMax}kg</h5>
            </> :
            <div>loading</div>
        }
    </div>
}
